import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <>
      <ul >
        <li>
          <Link to="/genres">Genres</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
        <li>
          <Link to="/shipping">Shipping</Link>
        </li>
      </ul>
    </>
  );
}

export default Navbar;
